import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
    createStyles,
    Paper,
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
    Theme,
    withStyles,
    WithStyles,
    Button,
} from '@material-ui/core';
import _ from 'lodash';
import { useSelector } from 'react-redux';

const userstate = {
    datarecords: []
};

const UserTable = (state: any) => {

    const logstate = useSelector((state: any) => state.isLogged);
    console.log("======TOKEN=======");
    console.log(logstate.token);
    const users: any[] = [];
    let modifydata:[]=[];
    console.log("======AUTHORIZATION=======");
    console.log('Bearer ' + logstate.token);
    axios.defaults.headers.common['Authorization'] = 'Bearer '+logstate.token;
    axios.get('https://localhost:44391/api/Dashboard')
        .then(response => {
            
            users.push(response.data);
            console.log(users);
            modifydata = users[0];
            userstate.datarecords = users[0];
            console.log("========DATA=======");
            console.log(userstate.datarecords);
            
        })
        .catch(error => {

        })
    console.log(userstate.datarecords, "===data===");
    return (
        
        <Paper >
            
            <h2>Employee List</h2>
            
            <Table >
                <TableHead>

                    <TableRow>
                        <TableCell><strong>Id</strong></TableCell>
                        <TableCell><strong>Name</strong></TableCell>
                        <TableCell><strong>Username</strong></TableCell>
                        <TableCell><strong>Email</strong></TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {users.map((val, j) => {
                        Object.keys(users[j]).forEach(key => {
                            return (

                                <TableRow key={users[j][key].user_id}>
                                    <TableCell>{users[j][key].user_id}</TableCell>
                                    <TableCell>{users[j][key].fullname}</TableCell>
                                    <TableCell>{users[j][key].username}</TableCell>
                                    <TableCell>{users[j][key].useremail}</TableCell>



                                </TableRow>
                            );
                        })
                    })}
                </TableBody>
            </Table>
        </Paper>

    );
}

export default UserTable;
